import React, { Component } from "react";

class App extends Component {
  state = { videos: [] };

  getVideos = async () => {
    const url = "http://localhost:5000/api/video";
    const response = await fetch(url);
    const data = await response.json();
    console.log(data);
  };

  componentDidMount() {
    try {
      this.getVideos();
    } catch (err) {
      console.log(err);
    }
  }
  render() {
    return <h1>Shootsta</h1>;
  }
}

export default App;
